function Dog(name) {
  this.name = name;
}

Dog.prototype.numLegs = 4;

let beagle = new Dog("Snoopy");

let ownProps = [];
let prototypeProps = [];

// Add your code below this line 

for (let property in beagle) {
  beagle.hasOwnProperty(property) ? ownProps.push(property) : prototypeProps.push(property);
}
